import React, { Component } from 'react';
import { Menu, Icon } from 'antd';

import { MENU_LINKS } from './constants';
import './index.scss';
import Link from 'next/link';
export default class NavigationMenu extends Component {
  constructor(props) {
    super(props);
    this.state = {
      current: undefined
    };
  }
  render() {
    return (
      <Menu selectedKeys={[this.state.current]} mode="horizontal">
        <Menu.Item key="home">מי אנחנו?</Menu.Item>
        <Menu.Item key="search">גלו מקומות חדשים</Menu.Item>
        <Menu.Item key="contact">צור קשר</Menu.Item>
        {MENU_LINKS.map(link => (
          //   <Link href={link.href}>
          <a>
            <Menu.Item key="home" className="link">
              מי אנחנו?
            </Menu.Item>
          </a>
          //   </Link>
        ))}
      </Menu>
    );
  }
}
